import React from 'react';
import './App.css';
// import MemberPanel from "./member/memberPanel";
// import MatchPanel from "./match/matchPanel";
import CivPanel from "./techtree/civPanel";
import TreePanel from "./techtree/panels/treePanel";
import Tree from "./techtree/panels/tree";


function App() {
  var x = new Tree();
  return (
    <div className="App">
      <h4> AGE OF EMPIRES 2 TECHNOLOGY TREE </h4>
      <div>
        <CivPanel />
        <table>
          <tbody>
            <tr>
            <TreePanel build="Archery Range" tree="range"/>
            <TreePanel build="Barracks" tree="barracks"/>
            <TreePanel build="Stable" tree="barracks"/>
            </tr>
            {/* <tr>
            <TreePanel build="Siege Workshop"/>
