            <TreePanel build="Monastery"/>
            </tr>
            <tr>
            <TreePanel build="Blacksmith"/>
            <TreePanel build="University"/>
            <TreePanel build="Dock"/>

            </tr>
            <TreePanel build="Economic Buildings"/> */}
          </tbody>
        </table>




      </div>
    </div>
  );
}

export default App;
